import React from 'react';
import Airphoto from "./image/src/image/AirBnb Experiences.png"

export default function Mainphoto() {
  return (
        <body>
             <img src={Airphoto}
             alt="airbnbphoto"
             className='navphotobnb'/>
        </body>
  );}
